import { useState } from 'react'
import Notes from './components/Note'

const App = ({ props }) => {

  const [notes, setNotes] = useState({notes})

  return (
    <div>
      <h1>Notes</h1>


      <ul>
        {notes.map((note) => 
        <li key = {note.id}>
          {note.content}
        </li>)}
      </ul>

      <ul>
        {notes.map(note => 
        <Notes key = {note.id} note={note}/>
        )}
      </ul>


    </div>
  )
}

export default App
